// Home.js
import { useState } from "react";
import "../stylesheets/Home.css";
import GifSection from "../components/GifSection";
import ToBinary from "../components/toBinary";

function Home() {
  const [payload, setPayload] = useState([]);
  return (
    <div className="home-container">
      <header className="home-header">
        <h1 className="home-title">Delving into Steganography</h1>
        <p className="home-subtitle">Explore & discover new ideas.</p>
      </header>

      <section className="home-cards">
        <div className="home-card">
          <h2>Project</h2>
        </div>

        <div className="home-card">
          <h2>Contact</h2>
        </div>
      </section>

      <GifSection />    {/* GIFUpload and FramePreview */}
      <ToBinary
        onBinaryReady={(binary) => {
          console.log("Binary received:", binary.length);

          // Example: store it, embed it, etc.
          setPayload(binary);
          console.log("Payload bits:", binary);

        }}
      />
    </div>
  );
}

export default Home;
